@-moz-document domain("google.ca")
{
  :root
  {
    --main-color: #0b0d0e;
    --accent-color: #242529;
    --font-color: #ffffff;
  }

/* Main Background */
  .jsx-4269593484, .home-container, .jsx-2546051494, .jsx-2763103118
  {
    background-color: var(--main-color) !important;
    background-size: auto !important;
  }

/* Header */
  .jsx-1445771017
  {
    background-color: var(--main-color) !important;
  }

/* Hamburger */
  .hamburger-menu .hamburger-menu-wrapper span
  {
